import pytest, time

def solution_original(S):
    occurrences = [0] * 26

    for i in range(len(S)):
        occurrences[ord(S[i]) - ord('a')] += 1

    best_char = 'a'
    best_res = occurrences[ord(S[i]) - ord('a')]

    for i in range(1, 26):
        if occurrences[i] > best_res:
            best_char = chr(ord('a') + i)
            best_res = occurrences[i]

    return best_char


def solution(S):
    occurrences = [0] * 26

    for i in range(len(S)):
        occurrences[ord(S[i]) - ord('a')] += 1

    best_char = 'a'
    best_res = 0

    for i in range(0, 26):
        if occurrences[i] > best_res:
            best_char = chr(ord('a') + i)
            best_res = occurrences[i]

    return sorted(best_char)[0]


def test_max_sorting_letters_solution():
    print(test_max_sorting_letters_solution.__name__)
    start_time = time.time()

    data = "hello"
    result = solution_original(data)

    assert result == "l"

    print("--- %s seconds ---" % (time.time() - start_time))


def test_maximum_letters_solution():
    print(test_maximum_letters_solution.__name__)
